import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Drawer from "@material-ui/core/Drawer";
import MovieIcon from "@material-ui/icons/Movie";
import PeopleIcon from "@material-ui/icons/People";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import "./scss/admin.css";
import { useHistory } from "react-router-dom";
import { Button } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
  },
  drawerClose: {
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
    overflowX: "hidden",
    width: theme.spacing(7) + 1,
    [theme.breakpoints.up("sm")]: {
      width: theme.spacing(9) + 1,
      height: "100%",
    },
  },
  content: {
    width: "100%",
  },
}));

export default function Admin() {
  const classes = useStyles();

  const history = useHistory();

  return (
    <div className={classes.root}>
      <Drawer variant="permanent" className={classes.drawerClose}>
        <List className="PaperStyle">
          <Button
            button
            onClick={() => {
              history.push("./admin/movieManagement");
            }}
            label="Item One"
          >
            <MovieIcon label="Item One" />
          </Button>
          <Button
            button
            onClick={() => {
              history.push("./admin/clientmanagement");
            }}
          >
            <PeopleIcon />
          </Button>
          <Button
            button
            onClick={() => {
              history.push("./admin");
            }}
          >
            <PeopleIcon />
          </Button>
        </List>
      </Drawer>
      <main className={classes.content}>123</main>
    </div>
  );
}
